import { dataAnimators } from "../data/dataAnimators";

function ItemDescription({id}) {


    return (
        <div>

        <div className="contBanner2" style={{backgroundImage: `url(${dataAnimators[id].image2})`}}>
            <div className="wrapper5">
            <h1>{dataAnimators[id].title}</h1>
            <div>
            <p>{dataAnimators[id].age}</p>
            <p>{dataAnimators[id].time}</p>
            <p>{dataAnimators[id].quantity}</p>
            </div>
            <button className="btnCTA">Оставить заявку</button> 
            </div>
        </div>

        <div className="wrapper6">
            <h2 className="titleText">Программа и активности</h2>
            <p className="text"></p>
        </div>

        <div className="wrapper6 programList" style={{backgroundImage: `url(${dataAnimators[id].image3})`}}>
            {dataAnimators[id].program.map(((item,index) => {
                return(
                    <ul key={index} className="">
                        <li>{item}</li>
                    </ul>
                )
            }))
            }
            <img src={dataAnimators[id].image3} alt="item"/>
        </div>
        </div>
    )
}

export default ItemDescription;
